import React, { useEffect, useState } from "react";
import axios from "axios";
import { toast } from "sonner";
import "./table.css";

const TableHeaderComponent = ({ url, keysToDisplay, displayedHeaders }) => {
    const [tableHeaders, setTableHeaders] = useState([]);

    useEffect(() => {
        const fetchData = async () => {
            try {
                const response = await axios.get(url);

                if (response.status === 200) {
                    const headers = displayedHeaders.map(
                        (key) => keysToDisplay[key]
                    );
                    setTableHeaders(headers);
                } else {
                    toast.error(
                        "Error while retrieving the advertisement columns"
                    );
                }
            } catch (error) {
                toast.error("Error while retrieving the advertisement columns");
                console.error("Error fetching data:", error);
            }
        };

        fetchData();
    }, [url, keysToDisplay, displayedHeaders]);

    return (
        <>
            {displayedHeaders.map((header, index) => (
                <th key={index} className="headerCell">
                    {header}
                </th>
            ))}
        </>
    );
};

export default TableHeaderComponent;
